import React from 'react';
import './login.css';

function Login(){
    return (
        <div className="mainContainer">
            <div className="leftPane">
                <h1>Welcome!<br/>
                    Please Log In
                </h1>
            </div>
            <div className="rightPane">
                <div className="loginWindow">
                </div>
            </div>    
        </div>
    );
}

export default Login;
